public static boolean isExtendedAcl(final String abfsSymbolicPermission) {
  if (abfsSymbolicPermission == null) {
    return false;
  }

  return abfsSymbolicPermission.charAt(abfsSymbolicPermission.length() - 1) == '+';
}
